import "./App.scss";
import FullScreen from "./pages/FullScreenMovie/FullScreen";
import Home from "./pages/Home/Home";
import Login from "./pages/Login/Login";
import Register from "./pages/Register/Register";
import { Link, Route, Switch } from "react-router-dom";

function App() {
  return (
    <Switch>
      <Route path="/" exact>
        <Home />
      </Route>
      <Route path="/movies">
        <Home type="movie" />
      </Route>
      <Route path="/series">
        <Home type="series" />
      </Route>
      <Route path="/login">
        <Login />
      </Route>
      <Route path="/register">
        <Register />
      </Route>
      <Route path="/watch">
        <FullScreen />
      </Route>
    </Switch>
  );
}

export default App;
